import React from 'react'
import {Box,User,Form,Txt,button} from './Hero.Elements'; 
import TextField from '@material-ui/core/TextField';
import { FaUserAlt } from "react-icons/fa";
import { AiFillLock } from "react-icons/ai";
import Button from '@material-ui/core/Button';



import InputAdornment from '@material-ui/core/InputAdornment';





function Hero() {
    return (
        <>
          <Box>
                <User>
                User Login
                </User>
                <Form>
               
               <TextField
                fullWidth
        id="input-with-icon-textfield"
        placeholder="UserName"
        label=""
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
                <FaUserAlt/>
            </InputAdornment>
          ),
        }}
      />      <Txt>
        <TextField
                fullWidth
        id="input-with-icon-textfield"
        placeholder="Password"
        type="password"
        label=""
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
                <AiFillLock/>
            </InputAdornment>
          ),
        }}
      /></Txt>
<input type="button" name="login" value="LOGIN" style={{padding:'10px',fontWeight:'bold',color:'white',backgroundColor:'black'}}/>
<input type="button" name="New User" value="New User" style={{padding:'10px',fontWeight:'bold',color:'white',backgroundColor:'black'}}/>

         </Form>
           </Box>
        </>
    )
}
export default Hero;
